import React from 'react';

import Header from '../components/Header';

function HomePage() {
  return (
    <div>
      <Header />
      <div>
        Welcome to my site!
      </div>
      <video autoplay loop muted>
        <source src="video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
}

export default HomePage;
